import * as React from 'react';
import ImageList from '@mui/material/ImageList';
import ImageListItem from '@mui/material/ImageListItem';
import flower1 from './flowers2.jpg';
import flower2 from './flowers1.jpg';
import flower3 from './flowers3.jpg';

export default function Hero() {
  return (
    <ImageList variant="woven" cols={3} gap={8}>
      {itemData.map((item) => (
        <ImageListItem key={item.img} style={{ height: '150px' }}> // Set a fixed height for ImageListItem
        <img
            srcSet={`${item.img}?w=${item.width}&fit=crop&auto=format`}
            src={`${item.img}?w=${item.width}&fit=crop&auto=format`}
            alt={item.title}
            loading="lazy"
        />
        </ImageListItem>
      ))}
    </ImageList>
  );
}

const itemData = [
  {
    img: flower1,
    title: 'Flower',
    width: 80, // Smaller width for flower1
  },
  {
    img: flower2,
    title: 'Flower',
    width: 120, // Larger width for flower2
  },
  {
    img: flower3,
    title: 'Flower',
    width: 80, // Smaller width for flower3
  },
];
